import React, { useState } from 'react'
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Button from '@material-ui/core/Button';

const SelectBot = (props) => {
    //const { selectedBot, setSelectedBot } = props;
    const [selectedBot, setSelectedBot] = useState();
    const [open, setOpen] = useState(false);

    const handleChange = (event) => {
        setSelectedBot(event.target.value);
    };

    const handleClose = () => {
        setOpen(false);
    };

    const handleOpen = () => {
        setOpen(true);
    };

    return (
        <div>
            <Button onClick={handleOpen}>
                Select a bot
      </Button>
            <FormControl >
                <div>
                    <InputLabel id="demo-controlled-open-select-label">Bot</InputLabel>
                    <Select
                        labelId="demo-controlled-open-select-label"
                        id="demo-controlled-open-select"
                        open={open}
                        onClose={handleClose}
                        onOpen={handleOpen}
                        value={selectedBot}
                        onChange={handleChange}
                    >
                        <MenuItem value={0}>Ten</MenuItem>
                        <MenuItem value={1}>Twenty</MenuItem>
                        <MenuItem value={2}>Thirty</MenuItem>
                    </Select>
                </div>
            </FormControl>
        </div>
    )
}

export default SelectBot
